/**
 * @class texture
 * {@link http://www.openwebglobe.org}
 * @author Martin Christen martin.christen@fhnw.ch
 */
function Texture(engine, useAsRenderTarget, framebufferWidth, framebufferHeight)
{
   this.engine = engine;   // pointer to the engine
   this.gl = engine.gl;    // pointer to the gl
   this.texture = null;    // the texture
   this.ready = false;     // is true when texture is ready to use
   this.failed = false;    // is true when texture creation / download failed
   this.blitMesh = null;   // optional mesh used for blitting
   this.width = 0;
   this.height = 0; 
   
   this.rttFrameBuffer = null; //used if this texture is used as a render target
   this.usedAsRenderTarget = false;
     
   if(useAsRenderTarget)   // texture is used as render target.
   {       
        this.rttFramebuffer = this.gl.createFramebuffer();
        this.gl.bindFramebuffer(this.gl.FRAMEBUFFER, this.rttFramebuffer);
        this.rttFramebuffer.width = framebufferWidth;
        this.rttFramebuffer.height = framebufferHeight;

        this.texture = this.gl.createTexture();
        this.gl.bindTexture(this.gl.TEXTURE_2D, this.texture);
        this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_MAG_FILTER, this.gl.LINEAR);
        this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_MIN_FILTER, this.gl.LINEAR);
     
        this.gl.texImage2D(this.gl.TEXTURE_2D, 0, this.gl.RGBA, this.rttFramebuffer.width, this.rttFramebuffer.height, 0, this.gl.RGBA, this.gl.UNSIGNED_BYTE, null);

        var renderbuffer = this.gl.createRenderbuffer();
        this.gl.bindRenderbuffer(this.gl.RENDERBUFFER, renderbuffer);
        //this.gl.renderbufferStorage(this.gl.RENDERBUFFER, this.gl.DEPTH_COMPONENT16, this.rttFramebuffer.width, this.rttFramebuffer.height);

        this.gl.framebufferTexture2D(this.gl.FRAMEBUFFER, this.gl.COLOR_ATTACHMENT0, this.gl.TEXTURE_2D, this.texture, 0);
        //this.gl.framebufferRenderbuffer(this.gl.FRAMEBUFFER, this.gl.DEPTH_ATTACHMENT, this.gl.RENDERBUFFER, renderbuffer);

        this.gl.bindTexture(this.gl.TEXTURE_2D, null);
        this.gl.bindRenderbuffer(this.gl.RENDERBUFFER, null);
        this.gl.bindFramebuffer(this.gl.FRAMEBUFFER, null);
        
        this.ready = true;
        this.usedAsRenderTarget = true;
        this.width = framebufferWidth;
        this.height = framebufferHeight;
        
   }
}

//------------------------------------------------------------------------------
/**
 * Loads the Texture image.
 * @extends texture
 * @param{string} url The url to download the image
 * @param callbackready An optional callback called when texture is ready. Has the texture class as param.
 * @param callbackfailed An optional callback called when texture failed. Has the texture class as param.
 */
Texture.prototype.loadTexture = function(url, callbackready, callbackfailed)
{
   // preparations
   this.texture = this.gl.createTexture();
   var texture=this.texture;
   var curgl = this.gl;
   var thismat = this;
   var cbr = callbackready;
   var cbf = callbackfailed;
   this.texture.image = new Image();
   this.texture.image.onload = function()
   {
      _cbHandleLoadedTexture(curgl, texture, cbr, thismat);
      thismat.ready = true;
   }
   this.texture.image.src = url;
   this.texture.image.onerror = function()
   {
      console.log("***FAILED DOWNLOADING: " + url);
      failed = true;
      if (cbf)
      {
         cbf(thismat);
      }
   }
   return this.texture;
}
//------------------------------------------------------------------------------
/**
 * @description Create WebGL texture object once it is available
 * @ignore
 */
function _cbHandleLoadedTexture(gl, textureobject, cb, TextureClass)
{
   // Create texture:
   gl.bindTexture(gl.TEXTURE_2D, textureobject);
   // gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);
   gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, textureobject.image);
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR);
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR);
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
   gl.bindTexture(gl.TEXTURE_2D, null);
   
   TextureClass.width = textureobject.image.width;
   TextureClass.height = textureobject.image.height;
   
   if (cb != null)
   {
      cb(TextureClass);
   }
   

}

//------------------------------------------------------------------------------
/**
 * Texture Binding, must be called before mesh.draw() called.
 * @extends texture
 *
 */
Texture.prototype.Enable = function()
{
   if (this.ready)
   {
      this.gl.activeTexture(this.gl.TEXTURE0);
      this.gl.bindTexture(this.gl.TEXTURE_2D, this.texture);
   }
}
//------------------------------------------------------------------------------
/**
 * Unbinds the texture
 * @extends texture
 *
 */
Texture.prototype.Disable = function()
{
   if (this.ready)
   {
      this.gl.bindTexture(this.gl.TEXTURE_2D, null);
   }
}
//------------------------------------------------------------------------------
/**
 * Blit Texture: Draw texture on screen
 * @extends texture
 */
Texture.prototype.Blit = function(x,y,z,angle,scalex,scaley,blend, invtexcoord)
{   
   if (z==null) { z = 0; }
   if (angle==null) {angle = 0;}
   if (scalex==null) {scalex = 1;}
   if (scaley==null) { scaley = 1; }
   if (blend==null)  { blend = false;}
   if (invtexcoord==null) {invtexcoord = false;}
   
   
   if (this.ready)
   {
      
       var w = this.width;
      var h = this.height;
      
      xr = this.width/2;
      yr = this.height/2;
      this.engine.PushMatrices();
      this.engine.SetOrtho2D();

      //deg 2 rad
      angle = MathUtils.Deg2Rad(angle);
      
      var model = new mat4();
    //  model.Translation(x,y,z);
      
 //     model.Set(new Float32Array([Math.cos(angle)*scalex, Math.sin(angle)*scalex,0,0, -Math.sin(angle)*scaley, Math.cos(angle)*scaley,0,0,0,0,1,0,Math.cos(angle)*x-Math.sin(angle)*y,Math.cos(angle)*y+Math.sin(angle)*x,z,1]));
      
     // model.Set(new Float32Array([Math.cos(angle)*scalex, Math.sin(angle)*scaley,0,0, -Math.sin(angle)*scalex, Math.cos(angle)*scaley,0,0,0,0,1,0,x,y,z,1]));
      
      
      //model.Set(new Float32Array([Math.cos(angle)*scalex, Math.sin(angle)*scaley,0,0,-Math.sin(angle)*scalex,Math.cos(angle)*scaley,0,0,0,0,1,0,Math.cos(angle)*scalex*(x-xr)+Math.sin(angle)*scalex*(yr-y)+scalex*xr,Math.cos(angle)*scaley*(y-yr)+Math.sin(angle)*scaley*(x-xr)+scaley*yr,z,1]));
      /*
      Math.cos(angle)*scalex     -Math.sin(angle)*scalex    0     Math.cos(angle)*scalex*(x-xr)+Math.sin(angle)*sx*(yr-y)+scalex*xr
      Math.sin(angle)*scaley     Math.cos(angle)*scaley     0     Math.cos(angle)*scaley*(y-yr)+Math.sin(angle)*sy*(x-xr)+scaley*yr
      0                          0                          1     z
      0 
      0                         0                          0     1
       */
      // model.Set(new Float32Array([scalex,0,0,0,0,scaley,0,0,0,0,1,0,-Math.cos(angle)*scalex*xr + Math.sin(angle)*scalex*yr + scalex*(x-xr),-Math.cos(angle)*scaley*yr - Math.sin(angle)*scaley*xr + scaley*(y-yr),z,1]));

          
       /*  s*tr*r*tm*rm*t 
       scalex,  0,           0,  -Math.cos(angle)*scalex*xr + Math.sin(angle)*scalex*yr + scalex*(x-xr),
       0,       scaley,      0,  -Math.cos(angle)*scaley*yr - Math.sin(angle)*scaley*xr + scaley*(y-yr),
       0,       0,           1,  z,
       0,       0,           0,  1]));
       */
       
       
       if(angle > 0)
       {
           model.Set(new Float32Array([Math.cos(angle)*scalex, Math.sin(angle)*scaley,0,0,-Math.sin(angle)*scalex,Math.cos(angle)*scaley,0,0,0,0,1,0,-Math.cos(angle)*scalex*xr + Math.sin(angle)*scalex*yr + scalex*xr + x,-Math.cos(angle)*scaley*yr - Math.sin(angle)*scaley*xr + scaley*yr + y,z,1]));

       }
       else
       {
          model.Translation(x,y,z);
       }
             
       /*
        *t*s*tr*r*tm 
        *
        * Math.cos(angle)*scalex     -Math.sin(angle)*scalex   0   -Math.cos(angle)*scalex*xr + Math.sin(angle)*scalex*yr + scalex*xr + x
        * Math.sin(angle)*scaley     Math.cos(angle)*scaley    0   -Math.cos(angle)*scaley*yr - Math.sin(angle)*scaley*xr + scaley*yr + y
        * 0                            0                       1     z
        * 0                            0                       0     1
        * 
        */
      this.engine.SetModelMatrix(model);
      
      //scale and rotation 
      
     
     
   

      if (this.blitMesh == null)
      {
         this.blitMesh = new Mesh(this.engine);

         if (!invtexcoord)
         {
            this.blitMesh.SetBufferPT(
               [0,0,0,   0,1,
                w,0,0,   1,1,
                w,h,0,   1,0,
                0,h,0,   0,0]);
          }
          else
          {   
             this.blitMesh.SetBufferPT(
               [0,0,0,   0,0,
                w,0,0,   1,0,
                w,h,0,   1,1,
                0,h,0,   0,1]);
          }

         this.blitMesh.SetIndexBuffer([0,1,2,0,2,3], "TRIANGLES");
         this.blitMesh.SetTexture(this);
      }

      if (blend)
      {
         this.engine.gl.enable(this.engine.gl.BLEND);
         this.engine.gl.disable(this.engine.gl.DEPTH_TEST);
         this.engine.gl.depthFunc(this.engine.gl.LEQUAL);
         this.engine.gl.blendFunc(this.engine.gl.SRC_ALPHA,this.engine.gl.ONE_MINUS_SRC_ALPHA);
      }
      else
      {
         this.engine.gl.disable(this.engine.gl.BLEND);
      }

      this.blitMesh.Draw();

      if (blend)
      {
         this.engine.gl.disable(this.engine.gl.BLEND);
         this.engine.gl.enable(this.engine.gl.DEPTH_TEST);
      }

      this.engine.PopMatrices();
   }
}
//------------------------------------------------------------------------------
/**
 * @description Free all memory, especially the GPU buffers.
 * @ignore
 */
Texture.prototype.Destroy = function()
{
   this.texture.image = null;
   engine.gl.deleteTexture(this.texture);
   this.texture = null;

   this.ready = false;
   this.failed = false;

   if (this.blitMesh)
   {
      this.blitMesh.Destroy();
      this.blitMesh = null;
   }

}
